import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, Form, FormControl, Button, NavDropdown, Container } from "react-bootstrap";

function App() {
  return (

    <div className="App">
      <Navbar bg="myGreen" expand='lg' collapseOnSelect>
        <Navbar.Brand >
          <img  id="logo" src={logo} />
          Logo
        </Navbar.Brand>

        <Navbar.Toggle />

        <Navbar.Collapse>

        <Nav>

          <NavDropdown title='Products'>
            <NavDropdown.Item href="#">Bikes</NavDropdown.Item>
            <NavDropdown.Item href="#">Pattini</NavDropdown.Item>
            <NavDropdown.Item href="#">Electric bikes</NavDropdown.Item>
          </NavDropdown>

          <Nav.Link href='#'>Services</Nav.Link>
          <Nav.Link href='#'>Contacts</Nav.Link>
        </Nav>

        </Navbar.Collapse>
      </Navbar>
    </div>

  );
}

export default App;
